import React from 'react';
import styled from 'styled-components';
import Maps from './Maps';
import BusinessRoundedIcon from '@mui/icons-material/BusinessRounded';
import CallIcon from '@mui/icons-material/Call';
import EmailIcon from '@mui/icons-material/Email';


const Container=styled.div`
position:absolute;
top:100%;
display:flex;
background-color:red;
width:100%;
`;

const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 20px;
`;

const Desc = styled.p`
  margin: 20px 0px;
  
`;

const Right = styled.div`
  flex:0.5;
  padding: 20px;
  
`;

const Center=styled.div`
flex: 1;
padding: 20px 10px;
margin-left:150px;
`;
const LogoContainer=styled.div`

`;
const Image=styled.img`
height:200px;
`;

const InfoContainer=styled.div`

`;
const Title=styled.div`
color:yellow;
font-size:30px;
margin-left:20px;
font-family: sans-serif;
`;
const Social=styled.div`


`;





const Footer = () => {
  return (
    <Container>
        <Left>
        <Desc>
        <h3>ADDRESS:</h3>

        <BusinessRoundedIcon /> 370, Jari Kondalampatty,<br/>
        Near Kondalampatty Roundana,<br/>
        Salem - 636 010.<br/>
        <br/>
        Corporate Office : <br/>
        364/1 B-E G2, Sahithyam Apartments,<br/>
        Chruch Road, Mugappair East, Chennai- 600 107.  <br/>
  
      <h3>Contact US:</h3>
      <Social>
        <Icons>
        <CallIcon/></Icons> Ph : 0427-2273477, 2273577.
        <Icons> <EmailIcon/></Icons> Email : universalcancerhospital@gmail.com	 
        
        </Social>
      
        </Desc>
       </Left>
       <Center>
        <Maps />
       </Center>
        <Right>
        <LogoContainer>
        <Image src="images/logo1.png"></Image>
        <InfoContainer>
        <Title>Accreditation</Title>
        <br/>
        <p>Universal Hospital has received full Accreditation Certification from National Accreditation Board for Hospitals & Healthcare Providers (NABH)</p>
        </InfoContainer>
        </LogoContainer>
      </Right>
    </Container>
  
  );
}

export default Footer;
